import BaseBox from "../components/BaseBox";
import DoubleBox from "../components/DoubleBox";

const HandRegist = () => {
  return (
    <BaseBox>
      <DoubleBox
        props1={{
          mx: "50px",
          my: "30px",
          p: "15px",
          width: "900px",
          borderRadius: "2%",
        }}
        props2={{ p: 2, height: "900px" }}
      >
        등록 페이지.
      </DoubleBox>
    </BaseBox>
  );
};

export default HandRegist;
